import 'bootstrap/dist/css/bootstrap.min.css';

interface ModalProps{
    children: React.ReactNode
    title: string
}

export function Modal({ children, title}: ModalProps) {
    return (
        <div className='position-sticky sticky-top"'>
            <h1 >{title}</h1>
            {children}
        </div>
    )
}
